import React from "react";
import PropTypes from "prop-types";
import Head from "next/head";
import "antd/dist/antd.css";
import { TwitterOutlined } from "@ant-design/icons";
import styled from "styled-components";
import withReduxSaga from "next-redux-saga";
import wrapper from "../store/configureStore";
import { Tooltip } from "antd";

const TwitterHeadIcon = styled(TwitterOutlined)`
  color: #00acee;
  font-size: 48px;
  padding: 10px;
`;
const HeaderTextFont = styled.div`
  color: black;
  font-weight: bold;
  font-size: 32px;
  padding: 10px;
`;
const Header = styled.header`
  background-color: yellow;
`;

const NodeBird = ({ Component }) => (
  <>
    <Head>
      <meta charSet="utf-8" />
      <title>NodeBird</title>
    </Head>
    <Header>
      <HeaderTextFont>
        <TwitterOutlined
          style={{ color: "#00acee", fontSize: "48px", padding: "10px" }}
        />
        NodeBird
        <Tooltip title="블로그로 이동합니다.">
          <a
            href="https://zucca.tistory.com"
            target="_blank"
            rel="noreferrer noopener"
            style={{ padding: "20px", float: "right" }}
          >
            Made by devZucca
          </a>
        </Tooltip>
      </HeaderTextFont>
    </Header>
    <Component />
  </>
);

NodeBird.propTypes = {
  Component: PropTypes.elementType.isRequired,
};
export default wrapper.withRedux(withReduxSaga(NodeBird));
